const navSlide=()=>{const e=document.querySelector(".burguer"),a=document.querySelector(".menu"),t=document.querySelectorAll(".navbar>ul>li");e.addEventListener("click",()=>{a.classList.toggle("menu-active"),t.forEach((e,a)=>{e.style.animation?e.style.animation="":e.style.animation=`navLinkFade 0.5s ease forwards ${a/5+1}s`}),e.classList.toggle("toggle")})};async function registerSW(){if("serviceWorker"in navigator)try{await navigator.serviceWorker.register("./sw.js")}catch(e){console.log("SW registration failed")}}navSlide(),$(".slider").slick({infinite:!0,arrows:!1,speed:500,fade:!0,cssEase:"linear",autoplay:!0,autoplaySpeed:4e3}),window.addEventListener("load",()=>{registerSW()});